        <select></select>
        <select></select>
        <input type="text" placeholder="ff"/>
        <input type="submit" value="ff" />
      </div>
      <article className="table">
        <table>
          <thead>
            <tr>
              <th>상품코드</th>
              <th>상품명</th>
              <th>색상</th>
              <th>사이즈</th>
              <th>지시매장재고</th>
            </tr>
          </thead>      
        </table>
      </article>
    </>
  )
}

